export function getModules() {
    return Modules;
  }

  export function CountValidation(Modules) {
    let Validated=0;
    let Total=0;
    for (let i=0; i<= Modules.length; i++){
      for (let j=0; j<= Modules[i].Chapters.length; j++){
        Total+=1;
        if (Modules[i].Chapters[j].IsValidated){
          Validated+=1;
        }
      }

    }
    return Validated/Total;
  }
